import { Nav, NavbarContainer, NavLogo } from './'
const Navbar = () => {
  return (
    <>
      <Nav>
        <NavbarContainer>
          <NavLogo>Financial Life</NavLogo>
        </NavbarContainer>
      </Nav>
    </>
  );
};

export default Navbar;
